const tasks = [
    {
        id: 1,
        text: '20 push ups',
        day: '29 juli at 14:30',
        reminder: true,
    },
    {
        id: 2,
        text: '3 uur ',
        day: '29 july at 15:00',
        reminder: true,
    },
    {
        id: 3,
        text: 'Doctors Appointment',
        day: '29 july at 16:30',
        reminder: true,
    },
    {
        id: 4,
        text: 'Doctors Appointment',
        day: '29 july at 17:30',
        reminder: false,
    },

]
const Tasks = () => {
    return (
        <div>
            {tasks.map((task) => (<h3>{task.text}</h3>))}
        </div>
    )
}

export default Tasks
